import React from 'react';
import GridList from '@material-ui/core/GridList';
import withWidth from '@material-ui/core/withWidth';
import GridListTile from '@material-ui/core/GridListTile';

import './grid-list.css'


const TitlebarGridList = ({ data, width, GridListItem }) => {
  return (
    <div className="root">
      <GridList cols = {width > 'sm' ? 1 : 2} cellHeight={300} spacing={20} className='grid-list' >
        {
           data.map( (item) => {
              return   <div
                        key = {item.id}>
                          <GridListItem
                              {...item}
                            />
                        </div>
            }
          )
        }
      </GridList>
    </div>
  );
}


export default withWidth()(TitlebarGridList);
